class BlogsModel {
  BlogsModel({
    String? type,
    String? message,
    Data? data,
  }) {
    _type = type;
    _message = message;
    _data = data;
  }

  BlogsModel.fromJson(dynamic json) {
    _type = json['type'];
    _message = json['message'];
    _data = json['data'] != null ? Data.fromJson(json['data']) : null;
  }

  String? _type;
  String? _message;
  Data? _data;

  BlogsModel copyWith({
    String? type,
    String? message,
    Data? data,
  }) =>
      BlogsModel(
        type: type ?? _type,
        message: message ?? _message,
        data: data ?? _data,
      );

  String get type => _type ?? "";

  String get message => _message ?? "";

  Data get data => _data ?? Data();

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['type'] = _type;
    map['message'] = _message;
    if (_data != null) {
      map['data'] = _data?.toJson();
    }
    return map;
  }
}

