class Data {
  Data({
    List<Plants>? plants,
    List<Seeds>? seeds,
    List<Tools>? tools,
  }) {
    _plants = plants;
    _seeds = seeds;
    _tools = tools;
  }

  Data.fromJson(dynamic json) {
    if (json['plants'] != null) {
      _plants = [];
      json['plants'].forEach((v) {
        _plants?.add(Plants.fromJson(v));
      });
    }
    if (json['seeds'] != null) {
      _seeds = [];
      json['seeds'].forEach((v) {
        _seeds?.add(Seeds.fromJson(v));
      });
    }
    if (json['tools'] != null) {
      _tools = [];
      json['tools'].forEach((v) {
        _tools?.add(Tools.fromJson(v));
      });
    }
  }

  List<Plants>? _plants;
  List<Seeds>? _seeds;
  List<Tools>? _tools;

  Data copyWith({
    List<Plants>? plants,
    List<Seeds>? seeds,
    List<Tools>? tools,
  }) =>
      Data(
        plants: plants ?? _plants,
        seeds: seeds ?? _seeds,
        tools: tools ?? _tools,
      );

  List<Plants> get plants => _plants??[];

  List<Seeds> get seeds => _seeds??[];

  List<Tools> get tools => _tools??[];

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (_plants != null) {
      map['plants'] = _plants?.map((v) => v.toJson()).toList();
    }
    if (_seeds != null) {
      map['seeds'] = _seeds?.map((v) => v.toJson()).toList();
    }
    if (_tools != null) {
      map['tools'] = _tools?.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

